package server;import java.util.concurrent.ConcurrentHashMap;public class RMMap<K,V> extends ConcurrentHashMap<K, V> {	private static final long serialVersionUID = 456879231252378734L;	public RMMap() {      super();    }    public String toString() {        StringBuilder builder = new StringBuilder("RMMapS { \n");        for (Entry<K, V> entry : this.entrySet()) {			builder.append("  [key = " + entry.getKey() + "] " + entry.getValue() + "\n" );		}        builder.append("}");        return builder.toString();    }    public void dump() {        System.out.println(toString());    }}